Fica a pessoa jurídica supracitada notificada da entrega dos laudos de análise fiscal emitidos pelo Laboratório  de Saúde Pública Dr. Giovanni Cysneiros, sendo ambos com conclusão satisfatória, conforme descrição:
1. laudo de análise fiscal n° 4782.00/2012 de suco de caju, fonte natural de vitamina C, marca Da Fruta, emitido em 22/05/2012;
2. laudo de análise fiscal n° 4514.00/2012 de suco de caju com alto teor de polpa, marca Maguary, emitido em 19/05/2012;
Ficam liberados os lacres nº 0004682 e 0004690 que estavam nas embalagens da amostra destinada a contra prova.
